import React from 'react';

const Card = () => {
    return ( <
        div >
        <
        img src = 'robohash.org/nejakytext'
        alt = "robot" / >
        <
        div >
        <
        h2 > Jane Doe < /h2> <
        p > jane.doe @gmail.com < /p> < /
        div > <
        /div>
    );
}

export default Card;
